class Solution(object):
    def sumPrefixScores(self, words):
        """
        :type words: List[str]
        :rtype: List[int]
        """
        lenght = len(words)

        if lenght == 1:
            return [len(words[0])]
        
        ans = [0] * lenght
        temp = []
        
        for i in range(lenght):
            for j in range(1,len(words[i]) + 1):
                temp.append(words[i][:j])

            tmp_lenght = len(temp)
            for k in range(tmp_lenght):
                for word in words:
                    if temp[k] == word[:len(temp[k])]:
                        ans[i] += 1

            temp = []
        
        return ans
    

